import './App.css';

function App() {
  return (
    <div className="App">
      <header className="top-bar">
        <div className="top-bar-title">
<img src="src/Bilder/Logo.png" />
        </div>

        <div className="top-bar-items">
        </div>
      </header>
    </div>
  );
}

export default App;
